import styled from "styled-components";

import MiniSideBar from "../organisms/main/MiniSideBar";

const SideBarBox = styled.div``;
function Main() {
  return (
    <>
      <SideBarBox>
        <MiniSideBar />
      </SideBarBox>

      <p>asdkaskd</p>
      <header>title</header>
      <h1>asdasd</h1>
    </>
  );
}

export default Main;
